drop table CRU_Mapping; 
drop table SOLAR_Mapping; 

DROP SEQUENCE CM_ID_seq;

DROP SEQUENCE SSM_ID_seq;
/

CREATE TABLE CRU_Mapping
(  C_ID NUMBER PRIMARY KEY,
   SOLAR_ID VARCHAR(60) NOT NULL, 
   CRU_LINK INT NOT NULL,
   SOL_CRATE VARCHAR(80) NOT NULL,
   SOL_BOARD_ID INT NOT NULL,
   PCI_ADDR VARCHAR(30) NOT NULL,
   CRU_ID INT NOT NULL,
   FLP_ID INT NOT NULL,
   STATION_ID INT NOT NULL,
   CH_ID INT NOT NULL,
   CH_SIDE VARCHAR(30) NOT NULL,
   SOL_LVPS VARCHAR(60) NOT NULL,
   SOL_CHAN VARCHAR(60) NOT NULL,
   FEC_LVPS VARCHAR(60) NOT NULL,
   FEC_DCHAN VARCHAR(60) NOT NULL,
   FEC_ACHAN VARCHAR(60) NOT NULL,
   SLAT_ID VARCHAR(60) NOT NULL,
     DS_CHAMBER VARCHAR(60) NOT NULL,
  DS_CHILDREN VARCHAR(60) NOT NULL,
  DS_SOLARFSM VARCHAR(60) NOT NULL
);
create sequence CM_ID_seq;

create or replace trigger trg_CM_id
     before insert on CRU_Mapping
     for each row
   begin
     select CM_ID_seq.nextval
       into :new.C_ID 
       from dual;
   end;
/
CREATE TABLE SOLAR_Mapping
(  SSM_ID NUMBER PRIMARY KEY,
   SOL_ID VARCHAR(60) NOT NULL, 
   FLEX_ID INT NOT NULL,
   SLAT_ID INT NOT NULL,
   DS_ID1 INT NOT NULL,
   DS_ID2 INT NOT NULL,
   DS_ID3 INT NOT NULL,
   DS_ID4 INT NOT NULL,
   DS_ID5 INT NOT NULL,
   STATION_ID INT NOT NULL,
   CH_ID INT NOT NULL,
   CH_SIDE VARCHAR(30) NOT NULL,
    DS_CHAMBER VARCHAR(60) NOT NULL,
  DS_CHILDREN VARCHAR(60) NOT NULL,
  DS_SOLARFSM VARCHAR(60) NOT NULL
);
create sequence SSM_ID_seq;

create or replace trigger trg_SSM_id
     before insert on SOLAR_Mapping
     for each row
   begin
     select SSM_ID_seq.nextval
       into :new.SSM_ID 
       from dual;
   end;
/



COMMIT;